RECORDS.ds_valor:
Estas foram as alterações solicitadas pela Hannover Veículos na proposta de layout que apresentamos a eles. A vendedora terá uma nova reunião no cliente nesta sexta-feira (28/05), portanto quero saber de vocês se é possível disponibilizarmos estas alterações até sexta de manhã.
São as seguintes:

- A proposta que mais agradou foi a primeira (www.agence.com.br/hannover), porém a HOME não agradou; eles gostaram apenas da página interna (www.agence.com.br/hannover/interna.htm). O cliente gostaria que a home seguisse a linha da página interna, apenas dando maior destaque ao logotipo da empresa;

- Ele solicitou a inclusão de outros logotipos de montadoras, ao lado dos que já estão lá: Porsche, BMW, Honda, Mitsubishi, Jaguar;

- Os textos utilizados no site contêm alguns erros de português (cometidos pelo próprio cliente). Eu (Guilherme) fiz uma revisão e passei estes textos para a Matriz de Escopo do projeto. Por favor peguem estes textos de lá;

- A foto da loja à noite é a preferida do cliente; ele pediu para colocarmos esta foto em destaque, no lugar daquelas quatro atualmente exibidas;

- O cliente quer uma opinião nossa: ele gostaria de colocar em todas as páginas internas uma foto da loja como pano de fundo da página (em marca d'água), mas não sabe se isso ficaria bom. Ele pensou na foto que aparece o estoque, com o Corolla na frente.
